int rowStart5Free[60] = {
    6, 7, 7, 7, 7, 7, 6, 7, 7, 7, 7, 7, 6, 7, 7, 7, 7, 7, 6, 7, 7, 7, 7, 7, 6, 7, 7, 7, 7, 7, 6, 7, 7, 7, 7, 7, 6, 7, 7, 7, 7, 7, 6, 7, 7, 7, 7, 7, 6, 7, 7, 7, 7, 7, 6, 7, 7, 7, 7, 7
};

vector<vector<int> > boundPool;

int go5Free(Factorization& d) {

    // Initialize variables

    // Define Gi[j] to be the greatest integer in row j+1
    int Gi[60] = {};
    greatestIntegerInRow(d, Gi, 60);

    // Define Li[j] to be the lower bound for array of integers j mod f
    int Li[60] = {};
    
    for (int i = 0; i < 60; i++) {
        for (int j = 0; j < boundPool[i].size(); j++) {
            Li[i] = max(Li[i], Gi[boundPool[i][j]]);
        }
    }

    // Define U to be the upper bound of integers in lattice
    int U = (d.pairs.back().x - 1) * (d.pairs.back().y - 1);

    // Define Ai to be the vectorbool of integers i mod f
    // Note that the +1 is for safety
    boost::dynamic_bitset<> Ai[60];
    for (int i = 0; i < 60; i++) {
        Ai[i].resize((U-Li[i]) / 60 + 1);
    }

    // Initialize the number of free numbers
    int countUnique = 0;
    for (int i = 0; i < 60; i++) {
        countUnique += (Li[i] + i) / 60;
    }

    // Algorithm

    int totalRows = d.pairs.back().x - 1;

    int totalProducts = 0;

    for (int i = 0; i < 60; i++) {

        for (int row = rowStart5Free[i], t = 1; row <= totalRows; 0) {

            while (d.pairs[t].x <= row) {
                t++;
            }

            int start = findStartColumn(Li[i], row, i, 60);

            int cStep = columnStep5Free[i][row % 60];

            int offset = (start * row - Li[i]) % 60;
            for (
                int p = (start * row - Li[i]) / 60;
                p < (d.pairs[t].y * row - Li[i] - offset + 59) / 60;
                p += (row * cStep) / 60
            ) {
                totalProducts += 1;
                // Ai[i][p] = true;
            }

            int rStep = rowStep5Free[i][row % 60];
            row += rStep;

        }

    }

    // this line
    return totalProducts;

    for (int i = 0; i < 60; i++) {
        countUnique += Ai[i].count();
    }

    return countUnique;
    
}
